[`Cell`]: core::cell::Cell
[`RefCell`]: core::cell::RefCell
[push]: BinaryHeap::push
[pop]: BinaryHeap::pop
[peek]: BinaryHeap::peek
[peek\_mut]: BinaryHeap::peek_mut

